10.body:
For this quickstart we are going to generate a few event shapes. TODO: Come up with a bit more interesting framing namespace com.quickstart.example /// Doc comment
structure EventA { int: Integer
}

11.body:
To use our generated shapes, simply create a module add import them using the generated_shapes! macro. mod shapes { use smithy4rs_core::generated_shapes; generated_shapes![];
} We can now use our generated shapes elsewhere in our rust code: fn main() { // Create a new, validated event instance let event = EventA::builder() .int(42) .build() .expect("Should Build"); // pretty-print the event println!("{:#?}", event)
} Found a bug? Edit this page on GitHub.

9.body:
We will now set up smithy-cargo to execute the Smithy CLI as part of the cargo build process. First, create a build.rs file at the root of your project and add the following build script: use smithy_cargo::SmithyBuild; fn main() { /// Executes the `smithy` CLI `build` command from cargo /// and configures some environment variables to point to the /// generated output folder. SmithyBuild::new().execute().expect("Smithy Build failed");
} Then, add a smithy-build.json file to the root of your project to configure the Smithy build: { "version": "1.0", "maven": { "dependencies": [ "dev.hmellema.smithy4rs:type-codegen:1.0.0" ] }, "plugins": { "rust-types": { "TODO": "ADD REAL CONFIG" } }
} Now, we are ready to create our model!
